import * as React from 'react';
import { AppBar, Toolbar, Drawer, Box, List, ListItem, ListItemText, Button } from '@mui/material';
import logo from './logo.png';  // Ensure this path is correct
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme';

const Navbar = () => {
  const [drawerOpen, setDrawerOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setDrawerOpen(!drawerOpen);
  };

  const drawer = (
    <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center', width: 250 }}>
      <List>
        <ListItem button>
          <ListItemText primary="Home" sx={{ textAlign: 'center', color: 'text.primary' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="About" sx={{ textAlign: 'center', color: 'text.primary' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Services" sx={{ textAlign: 'center', color: 'text.primary' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Contact" sx={{ textAlign: 'center', color: 'text.primary' }} />
        </ListItem>
      </List>
    </Box>
  );

  return (
    <AppBar position="static" sx={{ background: 'transparent', boxShadow: 'none' }}>
      <Toolbar sx={{ justifyContent: 'center', padding: '30px 0' }}> {/* Adds vertical padding */}
        {/* Logo on the left, but does not affect centering */}
        <Box sx={{ position: 'absolute', left: 20 }}>
          <img src={logo} alt="Logo" style={{ height: '50px' }} />
        </Box>

        {/* Centered menu items */}
        <Box sx={{ display: 'flex', justifyContent: 'center' }}>
          <Button color="inherit" sx={{ color: 'text.primary' }}>Home</Button>
          <Button color="inherit" sx={{ color: 'text.primary' }}>About</Button>
          <Button color="inherit" sx={{ color: 'text.primary' }}>Services</Button>
          <Button color="inherit" sx={{ color: 'text.primary' }}>Contact</Button>
        </Box>
      </Toolbar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={handleDrawerToggle}
      >
        {drawer}
      </Drawer>
    </AppBar>
  );
};

export default Navbar;
